def selectPath():
    path_ = tkinter.filedialog.askopenfilename()
    global path_all
    path_all = ""
    path_all = path_
    path.set(path_)


def printPath():
    x = tree.get_children()
    for item in x:
        tree.delete(item)
    imeicodes = [IMCode.get().strip(" ")[:32]]
    IMEICodes = []
    if imeicodes[0] == '':
        imeicodes.pop()
        if path_all != "":
            with open(path_all, "rb") as fp:
                IMEICodes = fp.readlines()
                for IMEICode in IMEICodes:
                    IMEICode = IMEICode.decode("utf8")
                    imeicodes.append(IMEICode[:32])
            fp.close()
        else:
            print("请选择任意一种方式运行程序")
        print("读入 IMEICode完成，共 {}".format(len(IMEICodes)))
        print(imeicodes)
    if not imeicodes:
        return
    for IMEICode in imeicodes:
        if IMEICode[0] == "#":
            print("跳过：" + IMEICode)
            continue
        aipaoer = Aipaoer(IMEICode)
        aipaoer.check_imeicode()
        aipaoer.get_info()
        aipaoer.get_runId()
        aipaoer.upload_record()
